 (3,'09database2model','  database2model  background background background problem statement new type of rubytl transformation how can we extract models conforming to specific ad-hoc metamodels from databases schemas ruby has a wide database library with several apis we try to make easier the extraction of models from the different existing databases and at the same time make the most of the sql power the database reverse engineering is basic to know what information is stored and how it can be used in other domains for knowledge extraction legacy systems or to other platforms migration information systems evolution in the first image can be seen the structure of a database to model transformation the starting point is any of the several existing database engines which conforms to a specific database schema the mapping is realised by the database2model transformation which maps from the elements of the schema to the elements of the metamodel database2model running example running example running example in our example the database engine is mysql and the schema corresponds to the wiki system mediawiki check schema image we see the wiki as a graph and we devised the wikigraph metamodel it is showed in figure of the metamodel schema graph ruby structure and sintaxis ruby structure and sintaxis ruby structure and sintaxis in the rake the user would specify the characteristics of the database engine the package has nothing special in the database parameter database should be defined the host e g localhost user e g root password e g u8e2809c12345u8e2809d and database name e g wikidb task rake schema_to_model extraction do t t sources package \''dbschema\'' database \''mysql\'' connection host user password database t targets package \''wiki\'' metamodel \''metamodels graph ecore\'' model \''models wiki xmi\'' t transformation \''transformations db2m database2model rb\'' end some details would be hidden to users such as the require statements e g require \''mysql\'' the connection to the database e g mysql real_connect host user password database and so forth the new rule type would be similar to the example in database2model rb the main query is the iterator i e the number of times the bindings are performed but secondary queries may also exist database2model rb creating models from the database rule \''nodes do from dbschema to wiki node mapping do db wnode main query \''select page_id page_title page_namespace page_counter from page\'' queries do q1 \''select count from revision o where rev_page \'' db page_id end wnode editions helper geteditions q1 count wnode node_id db page_id to_i wnode title db page_title wnode node_namespace db page_namespace wnode type helper gettype db page_namespace db page_title wnode visits db page_counter end end creating models from the already created instances wiki categorygraph new name \''categorygraph\'' do ca\''raph wiki node all_objects each do nodecat if nodecat type \''category\'' catgraph nodes nodecat end end wiki edge all_objects each do edgecat if edgecat to nil if edgecat from type \''category\'' and edgecat to type \''category\'' catgraph edges edgecat end end end end contribution contribution contribution uses cases description description description issues a known problem setting up the system the first time set passwordd for \''root\'' \''localhost\'' old_password \''12345\'' ; update mysql user set password old_password \''12345\'' where host \''localhost\'' and user \''root\''; flush privileges; references references references category collaborations '),
