 (19,'onekin','  onekin group  onekin is a research group mainly focused on the study of portal portlet engineering issues our group is localized at the university of the basque country research issues research issues research issues portal portlet engineering web application engineering software product line development spl document engineering semantic web engineering component based development cbse xml applications active databases category research '),
 (8,'usersindex',' 5 links for each user the page with most effort done the most edited page of the last 500 editions maximum no of editions stored the pag '),
 (21,'modelum','  bienvenido a la web del grupo modelum  formamos un equipo de investigaciu8c3b3n joven que arrancu8c3b3 su lu8c3adnea de trabajo en desarrollo dirigido por modelos dsdm a finales de 2003 estamos integrados dentro del grupo de investigaciu8c3b3n de ingenieru8c3ada del software de la universidad de murcia nuestras tres lu8c3adneas de trabajo principales son transformaciu8c3b3n de modelos lenguajes especu8c3adficos del dominio dsl modernizaciu8c3b3n de aplicaciones transformaciu8c3b3n de modelos transformaciu8c3b3n de modelos transformaciu8c3b3n de modelos en la lu8c3adnea de transformaciones de modelos hemos creado el lenguaje de transformaciu8c3b3n de modelos rubytl y el entorno age rubytl es un lenguaje de transformaciu8c3b3n junto con un conjunto de herramientas como un generador de cu8c3b3digo o un lenguaje de validacion que han sido implementados como dsl embebidos en ruby rubytl soporta un mecanismo de fases destinado a favorecer la modularidad y reutilizaciu8c3b3n en transformaciones de modelos dsl textuales dsl textuales dsl textuales en la lu8c3adnea de creaciu8c3b3n de dsl textuales nuestro interu8c3a9s principal se centra en investigar cu8c3b3mo soportar la extensibilidad y modularidad de los dsl y en las capacidades de los dsl embebidos en lenguajes orientados a objetos dinu8c3a1micos como ruby en la actualidad estamos desarrollando un framework de creaciu8c3b3n de dsl textuales modernizaciu8c3b3n de aplicaciones modernizaciu8c3b3n de aplicaciones modernizaciu8c3b3n de aplicaciones en la lu8c3adnea de modernizaciu8c3b3n de software hemos trabajado en algunos proyectos para empresas como la generaciu8c3b3n de wrappers java y servicios web para el acceso a lu8c3b3gica de negocio en pl-sql y la trasformaciu8c3b3n de struts a jsf con la experiencia de estos proyectos hemos iniciado la construcciu8c3b3n de un framework de modernizaciu8c3b3n para el escenario del cambio tecnolu8c3b3gico category research '),
 (22,'research',' in this category you can find different research groups '),
 (23,'tools',' different tools '),
