 (26,'java',' java technologies category tools '),
 (27,'j2ee',' the platform for enterprise solutions the java 2 platform enterprise edition j2ee defines the standard for developing multitier enterprise applications the j2ee platform simplifies enterprise applications by basing them on standardized modular components by providing a complete set of services to those components and by handling many details of application behavior automatically without complex programming the j2ee platform takes advantage of many features of the java 2 platform standard edition j2se such as write once run anywhere portability jdbc api for database access corba technology for interaction with existing enterprise resources and a security model that protects data even in internet applications building on this base the java 2 platform enterprise edition adds full support for enterprise javabeans components java servlets api javaserver pages and xml technology the j2ee standard includes complete specifications and compliance tests to ensure portability of applications across the wide range of existing enterprise systems capable of supporting the j2ee platform in addition the j2ee specification now ensures web services interoperability through support for the ws-i basic profile category java '),
 (28,'eclipse',' eclipse is a multi-language software development platform comprising an ide and a plug-in system to extend it it is written primarily in java and is used to develop applications in this language and by means of the various plug-ins in other languages as wellu8e28094c c cobol python perl php and more category j2ee '),
